function zipit() {
  var i;
  var j = 0;
  var found = 0;
  var zzz;
  var n_price_kg = 0;
  document.form1.ship_rate.value = 0;
  document.form1.fuel.value = 0;
  test_string = trim(document.form1.zipcode.value);
  
  // parse the origin and surcharge
  osc = document.form1.origin.value.substring(0,4);
  rtn = document.form1.origin.value.substring(5,7);
  
  // set up country constants
  switch(document.form1.Country.value) {
    case "us": { 
      zipcount = uszip3.length;
      zip3 = uszip3;
      if (rtn == "WC") {
        zipzone = uszone;
      } else {
        zipzone = useczones; // ct-this does not matter any more, no more EC WT
      }
      zipstate = usstate;
      zmatch = 3;
	  // Updagted 1/1/18
      // min_charge = 325.00;
	  min_charge = 350.00;
      break;
    }
    
    case "ca": {
      zipcount = cazip3.length;
      zip3 = cazip3;
      zipzone = cazone;
      zipstate = castate;
      zmatch = 3;
	  // Updated 1/1/18
      // min_charge = 325.00;
	  min_charge = 350.00;
      document.form1.ibf[0].checked=true;
	  document.form1.sw[0].checked=true;
	  document.form1.hsf[0].checked=true;
      break;
    }
	
    case "mx": {
      zipcount = mxzip3.length;
      zip3 = mxzip3;
      zipzone = mxzone;
      zipstate = mxstate;
      zmatch = 5;
	  // Updated 1/1/18
      // min_charge = 375.00;
	  min_charge = 400.00;
      document.form1.ibf[0].checked=true;
    }
  }
  document.form1.mc.value = min_charge.toFixed(2);
  
  // find the billing zone based on location code
  if (test_string.length >= 3) {
    var first = test_string.substring(0,1);
    var test = test_string.substring(0,zmatch);
    if (/[0-9]/.test(first)) {
      // first character is a number so a zip code
      ntest = parseInt(test,10); 
      if (ntest != 0) {
        for (i = 0; i <= zipcount; i++) {
          if(document.form1.Country.value == "us") {
            if ((ntest < parseInt(zip3[i],10)) && (found == 0)) {
              j = i;
              console.log(j, zip3[i]) //ct note
              found = 1;
            }
          } else {
            if ((ntest == parseInt(zip3[i],10)) && (found == 0)) {
              j = i;
              found = 1;
            }
          }
        }
      }
    } else {
      // first character is alpha so search canada
      test = test.toUpperCase();
      for (i = 0; i < zipcount; i++) {
        if ((test == zip3[i]) && (found == 0)) {
          j = i;
          found = 1;
        }
      }
    }
  }
  
  // Did we get a zone ?
  if (zipzone[j] == 0 && document.form1.zone.value != "Er") {
    document.form1.zone.value = "Er";
    alert("The zip or postal code you entered is not available for this service, please choose another");
  } else {
    document.form1.zone.value = zipzone[j];
    document.form1.zstate.value = zipstate[j];  
    console.log (zipzone.indexOf(zipzone[j])); //log zone index
    if (parseFloat(document.form1.weight_kg.value) >= parseFloat(document.form1.density_pivot.value)) {
       document.form1.chrg_weight.value = document.form1.weight_kg.value;
    } else {
       document.form1.chrg_weight.value = document.form1.density_pivot.value;
    }
    
	if (document.form1.chrg_weight.value > 800.0001) {
       if (rtn == "WC") {
          document.form1.price_kg.value = Number(w3[zipzone[j]].toFixed(4)) + Number(price_kg_add_on.toFixed(4));
      console.log(w3[zipzone[j]].toFixed(4));
      console.log(price_kg_add_on.toFixed(4));
        } else {
          document.form1.price_kg.value = Number(e3[zipzone[j]].toFixed(4)) + Number(price_kg_add_on.toFixed(4));
       }
     } else {
       if (rtn == "WC") {
         document.form1.price_kg.value = Number(w2[zipzone[j]].toFixed(4)) + Number(price_kg_add_on.toFixed(4));
         console.log(w2[zipzone[j]].toFixed(4),Number(w2[zipzone[j]].toFixed(4)));
         console.log ("base zone rate " + w2.indexOf(w2[zipzone[j]]))
         console.log("per kg add on  " + price_kg_add_on.toFixed(4));
         console.log("total of base zone rate+ add on   "+ document.form1.price_kg.value);
        } else {
         document.form1.price_kg.value = Number(e2[zipzone[j]].toFixed(4)) + Number(price_kg_add_on.toFixed(4));
       }
    }
	 
    // Add surcharge for origin
    document.form1.price_kg.value = (parseFloat(document.form1.price_kg.value) + parseFloat(osc)).toFixed(4);
    console.log("additional surcharge for origin "+ parseFloat(osc).toFixed(4))
    console.log("total per kg=zone base+ad_on+origin surcharge "+ document.form1.price_kg.value )
    //add rate increase	
  document.form1.price_kg.value = (parseFloat(document.form1.price_kg.value) * 1.0400).toFixed(2);
  console.log("rate increase of *1.04" )
  console.log("total per kg=zone base+ad_on+origin surcharge "+ document.form1.price_kg.value )
    document.form1.calc_ship_chg.value = (document.form1.price_kg.value * document.form1.chrg_weight.value).toFixed(2); 
	//round to $5
	document.form1.calc_ship_chg.value = (Math.round(document.form1.calc_ship_chg.value / 5) * 5).toFixed(2);
    document.form1.weight_cwt.value = (document.form1.chrg_weight.value * .022).toFixed(3);
    if (parseFloat(document.form1.calc_ship_chg.value) > min_charge) { 
       document.form1.ship_rate.value = document.form1.calc_ship_chg.value;
    } else {
       document.form1.ship_rate.value = min_charge.toFixed(2);
    }
	
    document.form1.fuel.value = (document.form1.ship_rate.value *0.263).toFixed(2);
    ibfit();
    swit();
    hsfit();
    destcost();
  }
}

