function destcost() {
  var td;
  var nd;
  var destn;
  destn = 0.00;
  for ( i=0; i < document.form1.elements.length; i++) {
    if (document.form1.elements[i].name.indexOf("cost") > 0) {
	  td = document.form1.elements[i].value;
	  if(IsNumeric(td)) {
	    nd = parseFloat(td);
	    destn = destn + nd;
	  }  
    }
  }
  document.form1.dest_charges.value = destn.toFixed(2);
  //pss_rate = 0.02;
  pss_charge = parseFloat(document.form1.weight_kg.value) * pss_rate;
  document.form1.pss.value = pss_charge.toFixed(2);
  document.form1.total.value = (parseFloat(document.form1.ship_rate.value) + parseFloat(document.form1.fuel.value) + destn + pss_charge).toFixed(2);
}

function IsNumeric(sText) {
  var ValidChars = "0123456789.-";
  var IsNumber = true;
  var Char;
  for (j = 0; j < sText.length && IsNumber == true; j++) {
    Char = sText.charAt(j);
	if (ValidChars.indexOf(Char) == -1) {
	  IsNumber = false;
	}
  }
  if (sText.length == 0) {
    IsNumber = false;
  }
  return IsNumber;
}

function trim(stringToTrim) {
  return stringToTrim.replace(/^\s+|\s+$/g,"");
}
